def minPath(grid, k):
    N = len(grid)
    seen = set()
    paths = []

    def dfs(row, col, path):
        if k == 0:
            paths.append(path[:])
            return

        seen.add((row, col))

        for dr, dc in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            nr, nc = row + dr, col + dc

            if 0 <= nr < N and 0 <= nc < N and (nr, nc) not in seen:
                dfs(nr, nc, path + [grid[nr][nc]])

        seen.remove((row, col))

    for i in range(N):
        for j in range(N):
            dfs(i, j, [grid[i][j]])

    min_path = min(paths, key=lambda path: [p for p in path])
    return min_path

